import React from "react";

const TopNav =() =>
{
    let students = [
        'Shanjai',
        'Gokul',
        'Rithik',
        'Theju',
        'Srinath'
    ]

    const add =(a,b) => a + b;

    return <ol>
         {students.map(students => {
            return <li>{students}</li>
         })}
    </ol>
}
<p>Sum : {add(1,3)}</p>

export default TopNav;
